import React from 'react';
import ProductList from '../components/ProductList';
import '../styles/Home.css';

const Home = () => {
    return (
        <div className="home-container">
            <header className="hero-section">
                <h1>Welcome to the Farm Marketplace</h1>
                <p>Your one-stop shop for fresh farm products, directly from farmers to your doorstep.</p>
                <button className="cta-button">Browse Products</button>
            </header>

            <section className="featured-products">
                <h2>Featured Products</h2>
                <p>Check out some of the best products available on our marketplace.</p>
                <ProductList />
            </section>
        </div>
    );
};

export default Home;
